import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import './App.css';
import Desktop from './Desktop';
import ListOfChannels from './ListOfChannels';
import Menu from './Menu';

function App() {
  return (
    <Router>
      <div className="app">
        <Switch>
          <Route path='/'>
            <Menu />
            <ListOfChannels />
            <Desktop />
          </Route>
          <Route path='/order'>
            <Menu />
            <ListOfChannels />
          </Route>
        </Switch>
      </div>
    </Router>

  );
}

export default App;
